import React from 'react'
import { Product } from '../../model/Product'
import './ProductItem.css'
interface props {
    product : Product,
    handleDelete : (id : string) => void ,
    setDataEdit : (course : Product) => void 
}
function ProductItem(propsx : props) { 
    console.log(propsx.product);

    return (
        <div className="dsBanChay">
            <div className="hinhAnh">
                <img src={propsx.product.image} />
            </div>
            <h2 className="tenSp">
            {propsx.product.name}
            </h2>
            <p className="gia">
            {propsx.product.price}
            </p>
            <p className="idSp">
            </p>
            <button onClick={()=>propsx.handleDelete(propsx.product.id)}><i className="fas fa-trash del" /> </button>
            <button onClick={()=>propsx.setDataEdit(propsx.product)}> <i className="fas fa-tools" /></button>
        </div>

    )
}
export default ProductItem
